import React, { Component } from 'react'
import { Serverurl, Serverurlimg } from '../Common/ServerUrl';
import axios from 'axios';
import renderHTML from 'react-render-html';


export class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [],
            title: "",
            address: "",
            event_date_time: "",
            event_type_id: "",
            country_id: "",
            state_id: "",
            city_id: "",
            area_id: "",
            imam_bargah_id: "",
            manqabat_khuwan_id: "",
            noha_khuwan_id: "",
            zakir_id: "",
            islamic_date: "",
            time: "",
            online_link: "",
            title_ur: "",
            address_ur: "",
            latitude: "",
            longitude: "",
            event_image: "",
        }
    }


    componentDidMount() {
        var data = {
            "id": localStorage.getItem("eventId")
        }
        axios({
            method: 'get',
            url: Serverurl + "event/view",
            params: data,
            headers: {
                'Authorization': `Bearer ${localStorage.getItem('token')}`,
            },
            config: {
                headers: { 'Content-Type': 'application/json' }
            }

        }).then(res => {
            console.log('res', res.data.data)
            console.log('hey', res.data)
            this.setState({
                title: res.data.title,
                address: res.data.address,
                event_date_time: res.data.event_date_time,
                event_type_id: res.data.event_type,
                country_id: res.data.country,
                state_id: res.data.state,
                city_id: res.data.city,
                area_id: res.data.area,
                imam_bargah_id: res.data.imam_bargah,
                manqabat_khuwan_id: res.data.manqabat_khuwan,
                noha_khuwan_id: res.data.noha_khuwan,
                zakir_id: res.data.zakir,
                islamic_date: res.data.islamic_date,
                time: res.data.time,
                online_link: res.data.online_link,
              
            })
            // $(document).ready(function () {
            //     $('#datatable2').DataTable();
            // });
            console.log('data', res.data.data)
        }).catch((err) => {
            console.log(err)
            if (err) {
                console.log('err', err.response)
                console.log({ err })
            }
        })
    }
    
    render() {
        return (
            <div className="container">
                <div class="row justify-content-center">
                    <div class="col-lg-11 col-sm-11">
                        <div class="card">
                            <div class="card-body table-responsive">
                                <div className="head view-list-style">
                                    <h4>Users Details</h4>
                                    <ul>
                                        <div class="row">
                                            <li class="col-12"><h5>Name</h5>
                                                {/* <h6>{this.state.first_name_view}{this.state.last_name_view}</h6> */}
                                            </li>
                                        </div>
                                        <div class="row">
                                            <li class="col-12">
                                                <h5>Email</h5>
                                                {/* <h6>{this.state.user_type_view == 1 ? "super admin" : "admin"}</h6> */}
                                            </li>
                                        </div>
                                        <div class="row">
                                            <li class="col-12">
                                                <h5>Message</h5>
                                                {/* <h6>{this.state.user_type_view == 1 ? "super admin" : "admin"}</h6> */}
                                            </li>
                                        </div>
                                    </ul>
                                    <div class="button-align">
                                        <a href="/component/gridContact" type="button" class="btn btn-danger waves-effect waves-light submit-button">Back</a>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home
